recommandationVideos.Description:
Mikrodumbliai – tai vienaląsčiai smulkučiai padarėliai, vieni seniausių gyvų organizmų Žemėje. Jų galima aptikti įvairiausiose vietose, o, jeigu atvyktumėte į FTMC, jų rastumėte... Bioelektrinių reiškinių laboratorijoje. 
Ten darbuojasi ir mikrodumblius tyrinėja FTMC Funkcinių medžiagų ir elektronikos skyriaus doktorantė Kamilė Jonynaitė. Ji aiškinasi, kaip už sekundę milijonus kartų trumpesni elektros impulsai keičia mikrodumblius – ir kokios naudos tai gali atnešti mums visiems. 
Jaunoji mokslininkė tinklalaidėje pasakoja apie savo tyrimus ir ne tik! 
Pokalbį veda Simonas Bendžius.

Garso įrašą LRT radiotekoje rasite čia: https://www.lrt.lt/mediateka/irasas/2000317293/tai-ka-jus-ten-darot-elektra-ir-mikrodumbliai

Temos: 

Kuo įdomi Bioelektrinių reiškinių laboratorija (0:00);
Mikrodumbliai ant mūsų studijos stalo (1:45);
Kas yra mikrodumbliai ir kuo skiriasi nuo „paprastų“ dumblių (4:00);
Kaip elektra padeda tirti mikrodumblius (6:40);
Bakterijų ir mikrodumblių santykiai (12:45);
Mikrodumblių visokeriopa nauda (15:55);
Kamilė – ne tik mokslo, bet ir vyno žinovė (9:13);
Tiriant mikrodumblius reikia daug kantrybės. Labai daug (24:55);
Sporto nauda mokslininkams (26:00).
